import React from 'react'
import { Container, makeStyles } from "@material-ui/core";
import { theme } from "../theme";
import { Box } from '@mui/system';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';




function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}



const useStyles = makeStyles((theme) => ({
    container: {
        height: "100vh",
        paddingTop: theme.spacing(2),
        backgroundColor: "#93cb40",
        position: "sticky",
        top: 0,
        [theme.breakpoints.up("sm")]: {
            backgroundColor: theme.palette.primary.main,
            border: "1px solid #ece7e7",
        },
    },

}))
const RightPlan = () => {
    const classes = useStyles();
    return (
        <Container className={classes.container}>

<Box
      sx={{
        width: 420,
        height: 500,
        backgroundColor: '',
        '&:hover': {
          backgroundColor: 'primary.main',
          opacity: [0.9, 0.8, 0.7],
        },
      }} 

      > <Button variant="contained" color="success"> Legend Count </Button> 
      <br></br> <br></br> <Button variant="contained" color="success"> Lighting </Button><br></br> 

      <br></br> <br></br><Button variant="contained" color="success">Power Point</Button> 




</Box>






    </Container>




    )
}

export default RightPlan
